import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom'; // For creating links to individual dish details

const DishList = () => {
  const [dishes, setDishes] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/dishes') // Replace with your actual backend API
      .then((response) => response.json())
      .then((data) => setDishes(data));
  }, []);

  return (
    <div>
      <h1>Dishes List</h1>
      <ul>
        {dishes.map((dish) => (
          <li key={dish.name}>
            <Link to={`/dish/${dish.name}`}>{dish.name}</Link> {/* Link to dish details */}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DishList;
